import React, { Component } from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom';

import MemoryData from './Components/MemoryData';
import PerformanceData from './Components/PerformanceData';
import LatencyData from './Components/LatencyData';
import ChangeValue from './Components/changeValue';
import Login from './Components/Login';
import PieChart from './Components/PieChart';
import BarChart from './Components/BarChart';

class App extends Component {
  render() {
    return (
      <Router>
          <div className="App">
             <Route exact path="/" component={Login} />
             <Route exact path="/Memory" component={MemoryData} />
             <Route exact path="/Latency" component={LatencyData} />
             <Route exact path="/Performance" component={PerformanceData} />
             <Route exact path="/Change" component={ChangeValue} />
             <Route exact path="/Pie" component={PieChart} />
             <Route exact path="/Bar" component={BarChart} />
          </div>
      </Router>
    );
  }
}

export default App;
